import React from 'react'
import './successSubmitQuote.css'

const SuccessSubmitQuote = () => {
  return (
    <div className="success-submit-quote-container">
        <div className="success-submit-quote-heading">
            <span>Your quote has been submitted!</span>
        </div>
    </div>
  )
}

export default SuccessSubmitQuote
